import 'dart:convert';

import 'package:flutter/material.dart';
import 'package:yc_flutter_plugin/src/ui/loading/yc_loading_animation.dart';

const String IMAGE_LOADING_EMPTY_DARK =
    "";

const String IMAGE_LOADING_EMPTY_LIGHT =
    "";

const String IMAGE_LOADING_ERROR_DARK =
    "";

const String IMAGE_LOADING_ERROR_LIGHT =
    "";

const String IMAGE_LOADING_FAILURE_DARK =
    "";

const String IMAGE_LOADING_FAILURE_LIGHT =
    "";

enum LoadingState {
  START, // 开始加载
  ERROR, // 网络错误
  EMPTY, // 无数据
  FAILURE, // 加载失败
  SUCCESS, // 加载成功
}

class YCLoading extends StatelessWidget {
  final Widget child;
  final bool dark;
  final LoadingState state;
  final Function retry;
  final String errorText;

  const YCLoading(
      {Key key,
      @required this.child,
      this.dark = false,
      @required this.state,
      this.retry,
      this.errorText = "纳尼？网络跑到了外太空"})
      : super(key: key);

  @override
  Widget build(BuildContext context) {
    if (state == null) {
      return child;
    }

    return state == LoadingState.SUCCESS
        ? child
        : Stack(
            children: <Widget>[child, _getStateView],
          );
  }

  Widget get _getStateView {
    switch (state) {
      case LoadingState.START:
        return _startView;
        break;
      case LoadingState.ERROR:
        return _errorView;
        break;
      case LoadingState.EMPTY:
        return _emptyView;
        break;
      case LoadingState.FAILURE:
        return _failureView;
        break;
      case LoadingState.SUCCESS:
        return null;
        break;
    }
    return null;
  }

  Widget get _startView {
    return Container(
      width: double.infinity,
      height: double.infinity,
      color: Colors.white,
      child: YCLoadingAnimation(),
      padding: EdgeInsets.only(top: 68),
      alignment: Alignment.topCenter,
    );
  }

  Widget get _errorView {
    return Container(
      color: Colors.white,
      child: Center(
          child: Column(
        mainAxisAlignment: MainAxisAlignment.start,
        children: <Widget>[
          Padding(
            padding: EdgeInsets.only(top: 68),
          ),
          dark
              ? Image.memory(
                  base64Decode(IMAGE_LOADING_ERROR_DARK),
                  scale: 3,
                )
              : Image.memory(
                  base64Decode(IMAGE_LOADING_ERROR_LIGHT),
                  scale: 3,
                ),
          Text(errorText),
          RetryButton(
            retry: retry,
          ),
        ],
      )),
    );
  }

  Widget get _emptyView {
    return Container(
      color: Colors.white,
      child: Center(
          child: Column(
        mainAxisAlignment: MainAxisAlignment.start,
        children: <Widget>[
          Padding(
            padding: EdgeInsets.only(top: 68),
          ),
          dark
              ? Image.memory(
                  base64Decode(IMAGE_LOADING_EMPTY_DARK),
                  scale: 3,
                )
              : Image.memory(
                  base64Decode(IMAGE_LOADING_EMPTY_LIGHT),
                  scale: 3,
                ),
          Text("暂无数据"),
        ],
      )),
    );
  }

  Widget get _failureView {
    return Container(
      color: Colors.white,
      child: Center(
          child: Column(
        mainAxisAlignment: MainAxisAlignment.start,
        children: <Widget>[
          Padding(
            padding: EdgeInsets.only(top: 68),
          ),
          dark
              ? Image.memory(
                  base64Decode(IMAGE_LOADING_FAILURE_DARK),
                  scale: 3,
                )
              : Image.memory(
                  base64Decode(IMAGE_LOADING_FAILURE_LIGHT),
                  scale: 3,
                ),
          Text("加载失败请重试！"),
          RetryButton(
            retry: retry,
          ),
        ],
      )),
    );
  }
}

class RetryButton extends StatefulWidget {
  final String text;

  final Function retry;

  const RetryButton({Key key, @required this.retry, this.text = "点击重试"}) : super(key: key);

  @override
  State<StatefulWidget> createState() {
    return RetryButtonState();
  }
}

class RetryButtonState extends State<RetryButton> {
  Color textColor = Color(0XFF222222);

  _changeButtonTextColor(bool down) {
    setState(() {
      textColor = down ? Color(0XFF999999) : Color(0XFF222222);
    });
  }

  @override
  Widget build(BuildContext context) {
    return GestureDetector(
        behavior: HitTestBehavior.opaque,
        onTapDown: (tapDownDetails) {
          _changeButtonTextColor(true);
        },
        onTapUp: (tapDownDetails) {
          _changeButtonTextColor(false);
        },
        onTapCancel: () {
          _changeButtonTextColor(false);
        },
        onTap: widget.retry,
        child: Container(
          margin: EdgeInsets.only(top: 20),
          width: 120,
          height: 43,
          decoration: BoxDecoration(
            border: Border.all(
              color: const Color(0XFFEEEEEE),
              width: 1,
            ),
            color: Colors.white,
            borderRadius: BorderRadius.all(Radius.circular(82)),
          ),
          child: Center(
            child: Text(
              widget.text,
              style: TextStyle(fontSize: 16, color: textColor),
            ),
          ),
        ));
  }
}
